INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('329', '716', 'ECS000329', '40°美国深蓝伏特加750ml', '+', '61', '175', '', '10000', '0.000', '548.40', '457.00', '0.00', '0', '0', '1', '', '', '<p style=\"text-align: center;\">&nbsp;</p>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; background-position: 0px 0px; background-repeat: repeat no-repeat;\">商品特点</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1;\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px;\"><img src=\"http://img01.jiuxian.com/upload/goods/11493/f/1380506273854.jpg\" original=\"http://img01.jiuxian.com/upload/goods/11493/f/1380506273854.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px;\"><font color=\"#333333\" size=\"2\"><strong>俏江南酒 如痴如醉</strong></font></p>\r\n            <p style=\"padding: 0px; margin: 0px;\"><font color=\"#666666\" size=\"2\">贵江南俏江南，从古至今，歌咏江南的大量文学作品构筑了中国人想象中的&ldquo;江南&rdquo;，在想象中的江南一直是秀丽富庶的形象，其为爱江南爱酒的人铸造了另一种&ldquo;江南&rdquo;&mdash;&mdash;俏江南，&ldquo;俏&rdquo;给柔媚的江南水乡增添了时尚优雅的感觉，酒如其名，品用俏江南，如痴如醉相见欢，似酒如密感情浓。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</dl></div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">商品展示</h4>\r\n<p style=\"text-align: center;\"><dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1;\"></dl></p>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1;\">\r\n<p align=\"center\" style=\"padding: 0px; margin: 0px;\"><img src=\"http://img01.jiuxian.com/upload/goods/11493/g/1380506239544.jpg\" original=\"http://img01.jiuxian.com/upload/goods/11493/g/1380506239544.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/11493/g/1380506244453.jpg\" original=\"http://img01.jiuxian.com/upload/goods/11493/g/1380506244453.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/11493/g/1380506248401.jpg\" original=\"http://img01.jiuxian.com/upload/goods/11493/g/1380506248401.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></p>\r\n</dl></div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">酒厂介绍</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/11495/m/1380442209373.jpg\" original=\"http://img01.jiuxian.com/upload/goods/11495/m/1380442209373.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#333333\" size=\"2\"><strong>成都市子云亭酒业有限公司</strong></font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">成都市子云亭酒业有限公司，地处中国著名传统白酒生产基地&mdash;川西平原，是巴蜀名酒生产的中心区域，这里气候和物产丰富、依山傍水、钟灵毓秀、千百年来一直是我国天然酿酒宝地。如今，已被国家白酒协会授予全国著名酿酒基地---OEM加工基地。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/11495/m/1380442599600.jpg\" original=\"http://img01.jiuxian.com/upload/goods/11495/m/1380442599600.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">公司占地20000多平方米，拥有两个优质酒生产基地，陈年老池300余个，年生产优质酒3000吨，并在民营企业中率先投入资金引进一流的检测设备和灌装生产线，建成检测手段完善、技术先进的质检中心和安全、快速、高效的灌装车间，年生产子云亭牌系列成品酒1000多吨，深得地方政府、合作厂商和消费者的青睐。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">适宜场合</h4>\r\n<div class=\"sych\" style=\"padding: 0px; margin: 0px;\">\r\n<div class=\"sych1\" id=\"gvsw0\" style=\"padding: 0px; margin: 0px; text-align: center;\"><span style=\"float: left; width: 197px; text-align: center;\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" original=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></span><span style=\"float: left; width: 197px; text-align: center;\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq1.gif\" original=\"http://misc.jiuxian.com/img/goods/gvhq1.gif\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></span><span style=\"float: left; width: 197px; text-align: center;\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" original=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></span><span style=\"float: left; width: 197px; text-align: center;\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" original=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></span></div>\r\n</div>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">仓储中心</h4>\r\n<div class=\"detail_prtpic\" style=\"padding: 0px; margin: 0px;\">\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/pic/goods/cx_bj.jpg\" width=\"768\" height=\"260\" alt=\"\" original=\"http://img01.jiuxian.com/pic/goods/cx_bj.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" /></p>\r\n</div>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">物流包装</h4>\r\n<div class=\"detail_prtpic\" style=\"padding: 0px; margin: 0px;\">\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/pic/goods/box_bj.jpg\" width=\"768\" height=\"300\" alt=\"\" original=\"http://img01.jiuxian.com/pic/goods/box_bj.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" /></p>\r\n</div>\r\n</div>', 'images/201312/thumb_img/329_thumb_G_1386626639351.jpg', 'images/201312/