68416674702.jpg\" original=\"http://img01.jiuxian.com/upload/goods/8075/b/1368416674702.jpg\" style=\"border: 0px; display: inline;\" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><span style=\"text-align: justify; widows: 2; font-size: 14px; line-height: 24px; font-family: arial, 宋体, sans-serif; orphans: 2; color: rgb(51, 51, 51);\"><font color=\"#333333\" size=\"2\"><strong>蒙林牌北冬虫夏草</strong></font></span></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><span style=\"text-align: justify; widows: 2; font-size: 14px; line-height: 24px; font-family: arial, 宋体, sans-serif; orphans: 2; color: rgb(51, 51, 51);\"><font color=\"#666666\" size=\"2\"><span style=\"font-size: 14px; color: rgb(51, 51, 51);\"><font color=\"#666666\" size=\"2\">蒙林牌北冬虫夏草</font></span>酒现拥有二十几款产品，在同类产品市场占有率达50%以上，是营养系列白酒里的知名品牌，深受广大消费者的欢迎和信赖！北冬虫夏草，蛹虫草为子囊菌亚门，麦角菌目，麦角菌科、虫草属的模式种。学名为Cordycepsmilitaris，又名北冬虫夏草、北蛹虫草、虫草等。世界性分布天然资源数量很少。由子座（即草部分）与菌核（即虫的尸体部分）两部分组成的复合体。冬季幼虫蛰居土里，菌类寄生其中，吸取营养，幼虫体内充满菌丝而死。到了夏季，自幼虫尸体之上生幼苗，形似草，夏至前后采集而得。</font></span></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\">\r\n<div class=\"Dmenu\" style=\"padding: 0px; margin: 0px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); background-attachment: scroll; background-color: transparent; height: 24px; line-height: 23px; background-position: 0px 0px; background-repeat: repeat no-repeat;\">\r\n<h3 style=\"padding: 0px; margin: 0px; background-image: url(http://img01.jiuxian.com/pic/goods/gv03.jpg); background-attachment: scroll; background-color: transparent; text-align: center; background-position: 10px 50%; background-repeat: no-repeat no-repeat;\"><span style=\"height: 20px; padding: 5px 0px 0px 25px; width: 200px;\">酒厂介绍</span></h3>\r\n</div>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/8075/m/1368417020830.jpg\" original=\"http://img01.jiuxian.com/upload/goods/8075/m/1368417020830.jpg\" style=\"border: 0px; display: inline;\" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#333333\" size=\"2\"><strong>内蒙古绿草原酒业有限公司</strong></font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">内蒙古绿草原酒业有限公司创建于1998年9月，座落在中国乳都&bull;呼和浩特市金川经济技术开发区北西乌素图，这里有得天独厚的地理环境和自然条件，背靠大青山，地理位置优越，交通便利，风景秀丽，绿树成荫，无工业污染。绿草原酒业是一家集研究、酿造、生产、销售为一体的专业化企业，其历史可追溯至清朝时就闻名的&ldquo;藏秘烧坊&rdquo;，具有悠久的酿酒渊源。而内蒙是一个具有丰富藏药才资源的省份。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            </td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/8075/m/1368415929401.jpg\" original=\"http://img01.jiuxian.com/upload/goods/8075/m/1368415929401.jpg\" style=\"border: 0px; display: inline;\" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">公司依托资源优势，采用古老而独特的藏曲发酵，以特有粮食作为主要原料，以无污染，纯洁甘甜，软硬适中的纯净水精心酿制各种浓香型虫草酒的基础上，采用千年藏传秘方和藏传工艺结合现代科学方法萃取北冬虫夏草、枸杞等有效成分研制出了具有滋补功效的养生酒。</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<div class=\"Dmenu\" style=\"padding: 0px; margin: 0px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); background-attachment: scroll; height: 24px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; background-position: 0px 0px; background-repeat: repeat no-repeat;\">\r\n<h3 style=\"padding: 0px; margin: 0px; background-image: url(http://img01.jiuxian.com/pic/goods/gv03.jpg); background-attachment: scroll; background-color: transparent; text-align: center; background-position: 10px 50%; background-repeat: no-repeat no-repeat;\"><span style=\"height: 20px; padding: 5px 0px 0px 25px; width: 200px;\">仓储中心</span></h3>\r\n</div>\r\n<div class=\"detail_prtpic\" style=\"padding: 0px; margin: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\">\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/pic/goods/cx_bj.jpg\" width=\"768\" height=\"260\" alt=\"\" original=\"http://img01.jiuxian.com/pic/goods/cx_bj.jpg\" style=\"border: 0px; display: inline;\" /></p>\r\n</div>\r\n<div class=\"Dmenu\" style=\"padding: 0px; margin: 0px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); background-attachment: scroll; height: 24px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; background-position: 0px 0px; background-repeat: repeat no-repeat;\">\r\n<h3 style=\"