INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('371', '720', 'ECS000371', '40°英国皇家礼炮21年1500ml', '+', '329', '201', '', '10000', '0.001', '1468.80', '1224.00', '1005.00', '1384848000', '1393660800', '1', '', '老窖青花 清秀典雅!', '<p style=\"text-align: center;\">&nbsp;</p>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; background-position: 0px 0px; background-repeat: repeat no-repeat;\">商品特点</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1;\">\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px;\"><img src=\"http://img01.jiuxian.com/upload/goods/3436/f/1373870507455.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3436/f/1373870507455.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" />&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px;\"><font color=\"#333333\" size=\"2\"><strong>老窖青花 清秀典雅</strong></font></p>\r\n            <p style=\"padding: 0px; margin: 0px;\"><font color=\"#666666\" size=\"2\">老窖青花瓷继承浓香型大曲酒传统工艺，精选高粱、小麦，及优质基酒勾兑而成。它具有&ldquo;窖香幽雅、绵柔甘冽、香味舒适、尾净余长&rdquo;的独特风格，更具有窖香浓，入口顺，回味香，一杯酒三重味道的全新体验，使人小酌一口而久久不能忘怀。</font>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px;\"><img alt=\"\" src=\"http://www.jiuxian.com/images/upload/Image/pd_tit_kinds_02.jpg\" width=\"750\" height=\"86\" original=\"http://www.jiuxian.com/images/upload/Image/pd_tit_kinds_02.jpg\" style=\"border: 0px; vertical-align: bottom; padding: 0px; line-height: 28px; margin: 0px; font-family: 宋体, Verdana, Arial; color: rgb(60, 62, 61); font-size: 14px; display: inline;\" /></p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n</dl></div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">商品展示</h4>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1;\"></dl>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1;\">\r\n<p style=\"padding: 0px; margin: 0px;\"><img src=\"http://img01.jiuxian.com/upload/goods/3436/g/1373870433121.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3436/g/1373870433121.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/3436/g/1373870437949.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3436/g/1373870437949.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n</dl></div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">品牌文化</h4>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/4338/b/1351665538975.jpg\" original=\"http://img01.jiuxian.com/upload/goods/4338/b/1351665538975.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" /></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            </td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">杜康酒是中国历史文化名酒，因黄帝时期的杜康始创秫酒而得名，距今已有4700年左右的历史，被誉为中国酒界鼻祖、白酒之源。杜康酒自问世以来，不仅被誉为&ldquo;天下第一美酒&rdquo;，更有&ldquo;进贡仙酒&rdquo;之称，留下了魏武帝曹操的&ldquo;何以解忧，唯有杜康&rdquo;。&nbsp;</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">唐代大诗人白居易的&ldquo;杜康能散闷，萱草解忘忧&rdquo;，北宋哲学家邵雍&ldquo;吃一辈子杜康酒，醉乐陶陶&rdquo;，金代元好问的&ldquo;总道忘忧有杜康，酒逢欢处更难忘&rdquo;等100多篇的诗文佳句，以及&ldquo;杜康造酒，酒醉刘伶，酣睡三年，方才睡醒&rdquo;等传说故事。</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/4338/b/1351929481542.jpg\" original=\"http://img01.jiuxian.com/upload/goods/4338/b/1351929481542.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" />&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\"><strong><font color=\"#333333\">杜康泉</font></strong>&nbsp;&nbsp;<br />\r\n            杜康河中的杜康泉，为天下名泉，泉水味甘质纯，清冽碧透，一溪北流，形成了杜康河。河中生长着一种长约一厘米的小虾，名五彩对虾，又称&ldquo;五色鸳鸯虾&rdquo;，全身澄黄，俩俩相抱，蜷腰横行，鸭食此虾产蛋呈桔红色，堪为天下珍奇。</font>&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1;\">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat;\">酒厂介绍</h4>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\"><img alt=\"\" src=\"http://www.jiuxian.com/images/upload/Image/1(70)(1).jpg\" width=\"750\" height=\"117\" original=\"http://www.jiuxian.com/images/upload/Image/1(70)(1).jpg\" style=\"border: 0px; vertical-align: bottom; padding: 0px; margin: 0px; display: inline;\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/4338/m/1351665825213.jpg\" original=\"http://img01.jiuxian.com/upload/goods/4338/m/1351665825213.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" />&nbsp;</p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\">&nbsp;</p>\r\n            </td>\r\n            <td style=\"padding: 0px; margin: 0px;\">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">洛阳杜康控股有限公司是以白酒为主导产业的综合性控股公司，其集研发、生产、经营、销售、管理于一体，旗下拥有汝阳杜康酿酒有限公司和河南杜康酒业股份有限公司（原伊川杜康）两大生产基地，先后登陆新加坡、台湾两地资本市场，成为河南白酒行业第一家也是当前唯一一家上市公司。</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center;\"><font color=\"#666666\" size=\"2\">作为&ldquo;杜康&rdquo;商标的唯一持有企业，洛阳杜康控股有限公司由汝阳、伊川两家杜康酒厂于2009年底重组而来，其同时拥有&ldquo;酒祖杜康、汝阳杜康、国花杜康&rdquo;等品牌的专属权，目前已经形成以酒祖杜康、国花杜康、中华杜康、绵柔杜康、杜康老窖、老杜康等六大系列为主的金字塔型产品线结构，涉及具体产品40多个。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><img src=\"http://img01.jiuxian.com/upload/goods/4338/m/1351665831166.jpg\" original=\"http://img01.jiuxian.com/upload/goods/4338/m/1351665831166.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline;\" alt=\"\" />&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center;\"><br />\r\n            <font color=\"#666666\" size=\"2\">洛阳杜康控股有限公司担负&ldquo;复兴杜康、为国争光&rdquo;的历史使命，自2009年底实现杜康战略整合后，重塑了以&ldquo;以拳头产品为核心，大产能为基础，大营销做支撑，带动杜康大品牌发展&rdquo;的主导性赢利模式，销售收入连续三年保持100%以上的高速增长