品质：</font></strong>天赐沃土，黍谷精华，凝水粮之纯，酿琼浆之真。宝丰贰号在酿造过程中，将酒曲与高粱原料固态形式配合，采纯粮固态发酵，以复杂独特的精湛工艺，确保酒体绝佳品质。其色清亮透明，玉洁冰清；其味窖香浓郁、酒体协调、丰满、干净、绵甜醇厚、柔和、回味悠长，备受消费者青睐。&nbsp;</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style=\"padding: 0px; margin: 0px; \">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; \"><img alt=\"\" src=\"http://www.jiuxian.com/images/upload/Image/pd_tit_kinds_02.jpg\" width=\"750\" height=\"86\" original=\"http://www.jiuxian.com/images/upload/Image/pd_tit_kinds_02.jpg\" style=\"border: medium none; vertical-align: bottom; padding: 0px; margin: 0px; display: inline; \" /></p>\r\n<p style=\"padding: 0px; margin: 0px; \">&nbsp;</p>\r\n</dl></div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px; \">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat; \">商品展示</h4>\r\n<p style=\"text-align: center; \">&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1; \"></dl>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" style=\"padding: 0px; margin: 0px; zoom: 1; \">\r\n<p align=\"center\" style=\"padding: 0px; margin: 0px; \"><img src=\"http://img01.jiuxian.com/upload/goods/3760/g/1352086193815.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/g/1352086193815.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><img src=\"http://img01.jiuxian.com/upload/goods/3760/g/1352086199786.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/g/1352086199786.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><img src=\"http://img01.jiuxian.com/upload/goods/3760/g/1352086204597.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/g/1352086204597.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></p>\r\n</dl></div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px; \">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat; \">品牌文化</h4>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;<img src=\"http://img01.jiuxian.com/upload/goods/3760/b/1352256713810.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/b/1352256713810.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;&nbsp; &nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; \">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">宝丰酒，以四千余年&ldquo;仪狄造酒&rdquo;古法为传承，不断发展创新，并坚持&ldquo;四清&rdquo;酿造标准，缔造&ldquo;清香纯正、绵甜柔和、甘润爽口、回味悠长&rdquo;等特点品质，连续摘夺我国白酒评比会大奖，成为清香型白酒的典型代表。先后出口新加坡、几内亚，直销中国香港、澳门、台湾等地区，原酒出口量全国第一，成品酒出口河南省第一。&nbsp;</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;<img src=\"http://img01.jiuxian.com/upload/goods/3760/b/1352256827107.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/b/1352256827107.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; \">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">历史，为企业打上深厚烙印。从夏、禹时的仪狄造酒起源；到隋唐时期的兴旺鼎盛，及明清时候的一路流香，在四千多年的历史中，宝丰酿造技艺绵延不绝，从未间断。历史的发展，也造就宝丰清香纯正的内涵。从大唐王朝把宝丰酒定为&ldquo;贡酒&rdquo;；到北宋，官方专设&ldquo;酒务&rdquo;，以管辖、指导宝丰酿造，宝丰清香，一路流芳。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</p>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px; \">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat; \">酒厂介绍</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&nbsp;<img src=\"http://img01.jiuxian.com/upload/goods/3760/m/1363331921211.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/m/1363331921211.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></font></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; \">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><br />\r\n            <font color=\"#666666\" size=\"2\">始建于1948年的宝丰酒业有限公司，是苏鲁豫皖四省中唯一一家生产</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">清香型白酒的企业，位列中国十七大名酒；所生产酿造的清香产品系</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">列，是河南名牌产品。企业先后被评为全国质量管理优秀企业、全国</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">食品工业优秀企业、全国酿酒行业双百家企业、全国白酒工业百强企</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">业、ISO9001质量体系认证企业等。2006年4月，宝丰酒业成功改制，</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">迎来企业全新发展。为是实现可持续发展，近年来宝丰投资3亿多元</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">，进行技术改造和科研开发。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&nbsp;</font></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&nbsp;</font></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&nbsp;</font></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&nbsp;<img src=\"http://img01.jiuxian.com/upload/goods/3760/m/1363331928176.jpg\" original=\"http://img01.jiuxian.com/upload/goods/3760/m/1363331928176.jpg\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></font></td>\r\n            <td style=\"padding: 0px; margin: 0px; text-align: center; \">&nbsp;</td>\r\n            <td style=\"padding: 0px; margin: 0px; \">\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">2008年，投资300多万元，对制曲设备、酿造设备进行更新改造，提</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">高了产品质量和产量；投资6800多万元，上了万吨储酒工程暨配套自</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">动化灌装生产线，建成后新增1万吨储酒能力，5万吨调酒及灌装能力</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">；加大生产，使企业年销量达20000吨，成品酒产品30000吨，原酒存</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">酒量30000吨；2010年完成产值8.9亿元&hellip;&hellip;此外，宝丰还组织科研人</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">员自行研发出哈工业首创的地缸发酵温度控制系统，成功解决发酵温</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">度控制难的问题，提高了酿酒产量和质量，由此，宝丰逐步成为了集</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">研发、生产、酿造、灌注、包装、销售为一体的大型酒企，各项主要</font></p>\r\n            <p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">经济指标均大幅攀升，销售收入连年翻番。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px; \">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat; \">获奖荣誉</h4>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;1956年，宝丰酒被评为河南名酒；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;1979年、1984年，在全国第三届、第四届白酒评比中，蝉联两届国优，并获国家银质奖；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;1989年，全国第五届白酒评比中，以得分最高荣获国家金质奖，晋升17大中国名酒；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;2002年，39度、46度清香型宝丰酒，被授予&ldquo;中华人民共和国国家标准样品&rdquo;称号；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;2002年，宝丰系列酒获国家&ldquo;原产地&rdquo;标记保护注册认证；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;2008年，宝丰酒酿造技艺入选第二批&ldquo;国家级非物质文化遗产&rdquo;名录；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;2009年，宝丰酒获&ldquo;纯粮固态发酵白酒标志&rdquo;授牌，荣升高档之列，体现酿造最高荣誉；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;2010年，荣获&ldquo;中华老字号&rdquo;（4000余年清香典范）荣耀认证；</font></p>\r\n<p style=\"padding: 0px; margin: 0px; text-align: center; \"><font color=\"#666666\" size=\"2\">&middot;宝丰国色清香酒被指定为河南省接待用酒，成为殊荣独具的高端品牌。</font></p>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px; \">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat; \">适宜场合</h4>\r\n<div class=\"sych\" style=\"padding: 0px; margin: 0px; \">\r\n<div class=\"sych1\" id=\"gvsw0\" style=\"padding: 0px; margin: 0px; text-align: center; \"><span style=\"float: left; width: 197px; text-align: center; \"><img src=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" original=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></span><span style=\"float: left; width: 197px; text-align: center; \"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" original=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></span><span style=\"float: left; width: 197px; text-align: center; \"><img src=\"http://misc.jiuxian.com/img/goods/gvlj0.gif\" original=\"http://misc.jiuxian.com/img/goods/gvlj0.gif\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></span><span style=\"float: left; width: 197px; text-align: center; \"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" original=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" style=\"border: 0px; vertical-align: bottom; display: inline; \" alt=\"\" /></span></div>\r\n</div>\r\n</div>\r\n<div class=\"part_box clearfix\" style=\"padding: 0px; margin: 0px 0px 10px; zoom: 1; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif, 宋体; line-height: 18px; \">\r\n<h4 class=\"h4_ass\" style=\"padding: 0px 10px; margin: 0px 0px 10px; height: 24px; line-height: 24px; background-image: url(http://img01.jiuxian.com/pic/goods/gv04.jpg); font-size: 14px; text-align: center; background-position: 0px 0px; background-repeat: repeat no-repeat; \">仓储中心</h4>\r\n<div class=\"detail_prtpic\" style=\"padding: 0px; margin: 0px; \">\r\n<p style=\"padding: 0px; margin: 0px; text-align: cen